import axios from "axios"
import {useEffect} from "react"
import { useNavigate } from "react-router-dom";
import { checkAuth,logout } from "../functions/Authorization";


function Home(){

    const navigate = useNavigate();

    useEffect(()=>{
        checkAuth(navigate)
        getRooms();    
    },[]);

    return(
        <div>
             <h1>Hello world</h1>
             <button onClick={logout.bind(this,navigate)}>Logout</button>
             <div>
                 <form>
                     <input name="title" type="text" palceholder="Title"></input>
                     <input name="description" type="text" palceholder="Description"></input>
                     <select name="npeople" id="r-npeople">
                         <option value="1">1</option>
                         <option value="2">1</option>
                         <option value="3">1</option>
                         <option value="Unlimited">Unlimited</option>
                     </select>
                     <input name="lang" type="text" palceholder="language" id="r-lang"/>
                     <datalist id="r-lang">
                         <option value="English" />
                         <option value="Tamil" />
                         <option value="Hindi" />
                         <option value="Telugu" />
                         <option value="Malayalam" />
                     </datalist>
                     <input type="file" name="roomImg" id="r-img" accept="image/*"></input>
                 </form>
             </div>
        </div>
       
    )
}

